import React from "react";

const JobBoardComponent = ({ job }) => {
  return (
    <div className="flex bg-white shadow-lg m-1">
      <div>
        <img src={job.logo} alt={job.company} />
      </div>
      <div></div>
      <div></div>
      <h1 className="text-3xl">{job.company}</h1>
    </div>
  );
};

export default JobBoardComponent;
